  bmlfTransformCustomFieldsPost(objDetail) {
    try {
      debugger;
      objDetail = objDetail.map(element => {
        let mDateColumns = ['CUSTOM1', 'CUSTOM2', 'CUSTOM3', 'CUSTOM4', 'CUSTOM5', 'CUSTOM6', 'CUSTOM7', 'CUSTOM8', 'CUSTOM9', 'CUSTOM10', 'USER1', 'USER2', 'USER3', 'USER4', 'USER5', 'USER6', 'USER7', 'USER8', 'USER9', 'USER10', 'USER11', 'USER12', 'User1', 'User2', 'User3', 'User4', 'User5', 'User6', 'User7', 'User8', 'User9', 'User10', 'User11', 'User12'];
        Object.keys(element).forEach(data => {
          if (mDateColumns.includes(data)) {
            let dateFormatVaild = moment__WEBPACK_IMPORTED_MODULE_0__(element[data], moment__WEBPACK_IMPORTED_MODULE_0__.ISO_8601, true).isValid();
            if (dateFormatVaild == true) {
              try {
                element[data] = this.bmlfGetFormatedDate(element[data]);
              } catch (e) {}
            } else {
              let localDataCtrl = this.mmJsonMap.get(data);
              if (localDataCtrl != undefined) {
                if (localDataCtrl['DataType'] == 'Float') {
                  if (element[data] == null || element[data] == undefined) {
                    element[data] = "0.00";
                  } else {
                    element[data] = Number(element[data]).toFixed(7);
                  }
                } else if (localDataCtrl['DataType'] == 'Decimal(22,6)') {
                  if (element[data] == null || element[data] == undefined) {
                    element[data] = "0.00";
                  } else {
                    element[data] = Number(element[data]).toFixed(7);
                  }
                } else if (localDataCtrl['DataType'] == 'Integer') {
                  if (element[data] == null || element[data] == undefined) {
                    element[data] = "0";
                  } else {
                    element[data] = element[data].toString();
                  }
                }
              } else {
                if (element[data] == null || element[data] == undefined) {
                  element[data] = "";
                } else {
                  element[data] = element[data];
                }
              }
            }
          }
        });
        return element;
      });
    } catch (error) {
      console.log(error);
    }
  }
  bmlfGetFormatedDate(dtValue) {
    var year, month, date, hour, min;
    var resultDt;
    year = dtValue.getFullYear();
    month = dtValue.getMonth() + 1;
    date = dtValue.getDate();
    hour = dtValue.getHours();
    min = dtValue.getMinutes();
    //2017-02-23 21:30:00
    resultDt = year.toString() + '-' + month.toString() + '-' + date.toString() + ' ' + hour.toString() + ':' + min.toString() + ':00';
    return resultDt.toString();
  }
  bmlfonSubmitData() {
    let pbResult;
    pbResult = this.bmlfonValidateData();
    this.mbResult = pbResult;
    if (pbResult) {
      //Save e-Signature function -S
      if (this.mbIsEsignature) {
        this.bmlfopenESignatureModal();
        return false;
      }
      //Save e-Signature Function -E
      //Customization
      let data = this.objUtils.bmgfCustomModelTransform(this.customCtrl);
      this.bmlfonAssignCustValues(data);
      this.bmlfTransformCustomFieldsPost(this.mArrGrid1);
      let parrCopyDatamArrGrid1 = this.mArrGrid1.map(ele => Object.assign({}, ele));
      parrCopyDatamArrGrid1.map(ele => {
        ele.EOQ = this.objUtils.bmgfSetPrecision(ele.EOQ, this.miPrecision);
        if (this.msFormMode == "I") {
          ele.Itemkey = this.mObjModel.ItemKey;
          ele.Location = this.mObjModel.Location;
        }
      });
      let reqData = {
        JSON: JSON.stringify({
          HeaderData: [{
            ...this.mObjModel
          }],
          DetailData: parrCopyDatamArrGrid1,
          Response: [{
            "ResponseText": "",
            "ErrorCode": ""
          }]
        })
      };
      this.objService.bmlfSave(reqData, this.msFormMode).subscribe(res => {
        if (res == null) {
          this.objToastService.notifyError(this.objUtils.bmgfonTranslate('COMMON.MSG.SERVERERROR'));
          return false;
        }
        if (res.Response[0].ErrorCode == "") {
          {
            this.mbDisabledPrimaryKey = true;
            if (this.msCallFor != "DeleteLine") {
              this.objToastService.notifySuccess(this.objUtils.bmgfonTranslate('COMMON.MSG.SAVE'));
            }
            if (this.mbHyerLinkData != null) {
              this.bmlfRedirectFunctionality();
            }
            if (this.msCallFor == "Save") {
              this.msFormMode = "U";
              this.mbInsert = false;
              this.mbChange = false;
              this.FieldExtender.mbChange = false;
              this.customCtrl.mbChange = false;
              this.mbShowDialog = false;
              if (this.msCopyRecord == 'Y') {
                this.msCopyRecord = 'N';
              }
              // FieldExtender -- start Insert
              //  let screenKeyValue = this.msScreenName + " — " + this.mObjModel.ItemKey; 
              let screenKeyValue = this.msScreenName + " — " + this.mObjModel.Location + "×" + this.mObjModel.ItemKey;
              let jsonData = this.FieldExtender.bmlfSaveData(screenKeyValue);
              if (jsonData.length > 0) {
                this.FieldExtender.bmlfCallApi(jsonData).then(res => {
                  if (res != null) {}
                });
              }
              ;
              this.msItemKey = this.mObjModel.ItemKey;
              this.msLocation = this.mObjModel.Location;
              this.bmlfGetDataOnLoad();
              // FieldExtender -- End Insert
              this.bmlfonURL(this.mObjModel.ItemKey);
            } else if (this.msCallFor == "Add") {
              this.mbShowDialog = false;
              this.bmlfClearControl();
            } else if (this.msCallFor == "DeleteLine") {
              this.msFormMode = "U";
              this.mbInsert = false;
              this.mbChange = false;
              this.FieldExtender.mbChange = false;
              this.customCtrl.mbChange = false;
              this.mbShowDialog = false;
              if (this.msCopyRecord == 'Y') {
                this.msCopyRecord = 'N';
              }
              // FieldExtender -- start Insert
              let screenKeyValue = this.msScreenName + " — " + this.mObjModel.ItemKey;
              let jsonData = this.FieldExtender.bmlfSaveData(screenKeyValue);
              if (jsonData.length > 0) {
                this.FieldExtender.bmlfCallApi(jsonData).then(res => {
                  if (res != null) {}
                });
              }
              ;
              this.bmlfonDeleteGrid1Line();
            } else if (this.msCallFor == "Search") {
              this.msFormMode = "I";
              this.mbChange = false;
              this.mbShowDialog = false;
              this.mbDisabledPrimaryKey = true;
              if (this.mbSearchAfterSave) {
                this.bmlfOnSearchValidation();
              }
            } else if (this.msCallFor == "Copy") {
              this.bmlfonSetFormMode("I", "Copy");
              this.mbShowDialog = false;
              this.bmlfonURL("");
              setTimeout(function () {
                document.getElementById('txtItemKey').focus();
              }, 10);
            } else {
              this.mbShowDialog = false;
              this.bmlfClearControl();
            }
            if (this.msCallFor == "FormClose") {
              this.router.navigate([this.msRoutePath]);
            }
          }
        } else {
          //if (res.Response[0].ErrorCode == "") {
          if (this.objUtils.bmgffindString(res.Response[0].ResponseText, 'EXISTS')) {
            this.objToastService.notifyError(this.objUtils.bmgfonTranslate('COMMON.MSG.EXIST'));
            setTimeout(function () {
              document.getElementById('txtTestPlanID').focus();
            }, 10);
          } else {
            this.objToastService.notifyError(res.Response[0].ResponseText);
          }
          //this.objToastService.notifyError(res.Response[0].ResponseText)
          this.mbShowDialog = false;
        }
      });
    }
    this.mbShowDialog = false;
  }
