        ele.PlanDateEnd = moment__WEBPACK_IMPORTED_MODULE_3__(ele.PlanDateEnd).format(this.msCustomDateFormat.toUpperCase());
        let psDate = ele.PlanDateStart.replace(/[/]/g, '_');
        let pdChkDate = this.utilService.bmlfSetDateAsDateFormat(ele.PlanDateStart);
        let parrChkHolidays = [];
        if (ele != 'Type') {
          parrChkHolidays = this.marrHolidayListCalendar.filter(e => e.Date.getTime() == pdChkDate.getTime());
        }
        let pobjCol = {};
        pobjCol.Field = `Date_${psDate}`;
