  bmlfGetGridSettingpPurOrd() {
    let pobjReqData1 = {
      ScreenName: 'UserSettingsListingPage',
      LookUpKey: 'ListingJSONString',
      Filter1: this.msScreenName,
      Filter2: this.mobjUserData.UserId
    };
    this.userFieldService.GETGeneralSqlData(pobjReqData1).subscribe(res => {
      if (res != null && res.LookupData.length > 0) {
        this.marrDefaultGridSetting = res.LookupData[0].JSONString;
      } else {
        this.marrDefaultGridSetting = this.marrLineItemCol;
      }
    });
  }
  // Set Default Format
  bmlfgetDefaultAppSetup() {
    let pobjReqData1 = {
      ScreenName: 'POEntryComponent',
      LookUpKey: 'DecimalPrecision'
    };
    this.userFieldService.GETGeneralSqlData(pobjReqData1).subscribe(res => {
      if (res.LookupData.length) {
        let parrSalesDefaultQtyDes = res.LookupData;
        parrSalesDefaultQtyDes.forEach(ele => {
          this.miQtyPrecision = ele.Default_Value || 2;
          let formatType = typeof ele.Default_Value == 'number' ? String(ele.Default_Value) : ele.Default_Value;
          this.miQtyPrecisionFormat = 'n' + formatType || 0;
        });
      }
    });
    let parrDefaultFormat = JSON.parse(localStorage.getItem("defaultFormats"));
    parrDefaultFormat.forEach(ele => {
      if (ele.Default_Key == "CURR_DECIMAL") {
        this.miAmountPrecision = Number(ele.Default_Value);
        this.miAmountPrecisionFormat = 'n' + this.miAmountPrecision;
      }
    });
    this.msCustomDateFormat = this.dateFormatService.getDateFormat();
    this.msCustomDateTimeFormat = `${this.msCustomDateFormat} hh:mm:ss a`;
    // Get MPS Setup Data
    let pobjReqData = {
      ScreenName: 'MPS Setup',
      LookUpKey: 'GetMPSSetup'
    };
    this.userFieldService.GETGeneralSqlData(pobjReqData).subscribe(res => {
      if (res == null) {
        return false;
      }
      if (res.LookupData.length) {
        this.mobjMpsSetupData = res.LookupData[0];
        let psUser1, psUser2;
        if (src_app_core_services_custom_validators__WEBPACK_IMPORTED_MODULE_5__.CustomValidator.bmgfNullCheckValidator(this.mobjMpsSetupData.User1)) {
          psUser1 = [];
        } else {
          psUser1 = this.mobjMpsSetupData.User1.split(',');
        }
        if (src_app_core_services_custom_validators__WEBPACK_IMPORTED_MODULE_5__.CustomValidator.bmgfNullCheckValidator(this.mobjMpsSetupData.User2)) {
          psUser2 = [];
        } else {
          psUser2 = this.mobjMpsSetupData.User2.split(',');
        }
        if (psUser1.length) {
          let psChkUser1 = psUser1.filter(i => i == this.mobjUserData.UserId);
          this.isUserRightException1 = psChkUser1.length > 0 ? true : false;
        }
        if (psUser2.length) {
          let psChkUser2 = psUser2.filter(i => i == this.mobjUserData.UserId);
          this.isUserRightException2 = psChkUser2.length > 0 ? true : false;
        }
        this.bmlfGetPnanningCalendar(this.mobjMpsSetupData.CalendarKey);
      }
    }, err => {
      console.log(err);
    });
  }
