  // Get MPS DashboardData
  bmlfOnGetMPSDashboardData() {
    this.mbIsLoading = true;
    let pobjReqData = {
      JSON: JSON.stringify({
        Parameters: [],
        Response: [{
          ResponseText: "",
          ErrorCode: "",
          Pdfpath: ""
        }]
      })
    };
    this.mrpDashboardService.bmlfGetMrpDashboardData(pobjReqData).subscribe(res => {
      this.mbIsLoading = false;
      if (res == null) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('COMMON.MSG.NODATA'));
        return false;
      }
      if (Object.entries(res).length > 0) {
        // res.ItemDetails = JSON.parse(JSON.stringify(res.ItemDetails).replace(/[\(\)']+/g,''));
        res.ItemDetails = JSON.parse(JSON.stringify(res.ItemDetails).replace(/\s(?=\w+":)/g, ""));
        res.ItemDetails.forEach((ele, idx) => {
          ele.Select = idx;
          ele.MRP_last_run = moment__WEBPACK_IMPORTED_MODULE_3__(ele.MRP_last_run).format(this.msCustomDateFormat.toUpperCase());
          ele.QtyOnHand = ele.QtyOnHand ? this.utilService.bmgfSetPrecision(ele.QtyOnHand, this.miQtyPrecision) : this.utilService.bmgfSetPrecision(0, this.miQtyPrecision);
          ele.SafetyStock = ele.SafetyStock ? this.utilService.bmgfSetPrecision(ele.SafetyStock, this.miQtyPrecision) : this.utilService.bmgfSetPrecision(0, this.miQtyPrecision);
          ele.EOQ = ele.EOQ ? this.utilService.bmgfSetPrecision(ele.EOQ, this.miQtyPrecision) : this.utilService.bmgfSetPrecision(0, this.miQtyPrecision);
          ele.Demand = ele.Demand ? this.utilService.bmgfSetPrecision(ele.Demand, this.miQtyPrecision) : this.utilService.bmgfSetPrecision(0, this.miQtyPrecision);
          ele.Supply = ele.Supply ? this.utilService.bmgfSetPrecision(ele.Supply, this.miQtyPrecision) : this.utilService.bmgfSetPrecision(0, this.miQtyPrecision);
          // for client issue
          ele.QtyOnHand_Purchase_UOM = ele.QtyOnHand_Purchase_UOM ? this.utilService.bmgfSetPrecision(ele.QtyOnHand_Purchase_UOM, this.miQtyPrecision) : this.utilService.bmgfSetPrecision(0, this.miQtyPrecision);
          ele.Demand_Purchase_UOM = ele.Demand_Purchase_UOM ? this.utilService.bmgfSetPrecision(ele.Demand_Purchase_UOM, this.miQtyPrecision) : this.utilService.bmgfSetPrecision(0, this.miQtyPrecision);
          ele.Supply_Purchase_UOM = ele.Supply_Purchase_UOM ? this.utilService.bmgfSetPrecision(ele.Supply_Purchase_UOM, this.miQtyPrecision) : this.utilService.bmgfSetPrecision(0, this.miQtyPrecision);
          ele.SafetyStock_Purchase_UOM = ele.SafetyStock_Purchase_UOM ? this.utilService.bmgfSetPrecision(ele.SafetyStock_Purchase_UOM, this.miQtyPrecision) : this.utilService.bmgfSetPrecision(0, this.miQtyPrecision);
          ele.EOQ_Purchase_UOM = ele.EOQ_Purchase_UOM ? this.utilService.bmgfSetPrecision(ele.EOQ_Purchase_UOM, this.miQtyPrecision) : this.utilService.bmgfSetPrecision(0, this.miQtyPrecision);
          //let pnumQtyOnHandMRP = Number(ele.QtyOnHand) - Number(ele.SafetyStock)- Number(ele.Less_Non_Nettable_Qty)- Number(ele.Less_Expired_Lot_Qty);
          let pnumAvaQty = Number(ele.QtyOnHand) - Number(ele.SafetyStock) - Number(ele.Less_Over_Sold_Qty) - Number(ele.Less_Non_Nettable_Qty) - Number(ele.Less_Expired_Lot_Qty);
          ele.QtyOnHandatMrpRun = this.utilService.bmgfSetPrecision(Number(ele.MPS_Run_CurrentQty_Onhand), this.miQtyPrecision);
          ele.AvailableQty = this.utilService.bmgfSetPrecision(pnumAvaQty, this.miQtyPrecision);
        });
        this.marrItemGridData = res.ItemDetails;
        this.marrItemGridData[0].Select = 0;
        this.itemSelected = 0;
        this.marrSelectedItemRecord = this.marrItemGridData[0];
        this.bmlfOnFetchItemsEvn(this.msSelectedFetchEvent);
      }
    }, err => {
      this.mbIsLoading = false;
      console.log(err);
    });
  }
