  // GlobalOnChanges Event
  bmlfonGlobalOnChangesFn(psFieldName, pobjFieldData, piIndex, eleId) {
    if (pobjFieldData == null) {
      return false;
    }
    if (this.marrDefaultGridSetting != undefined) {
      let parrJson = JSON.parse(this.marrDefaultGridSetting);
      parrJson.columnsConfig.forEach(ele => {
        if (ele.field == psFieldName && ele.isReadOnly) {
          this.mbIsChange = true;
        }
      });
    }
    // this.marrLineItemCol.forEach(ele => {
    //   if (ele.Field == psFieldName && ele.IsReadOnly) {
    //     this.mbIsChange = true;
    //   }
    // });
    if (psFieldName == "selectedItem") {
      // this.mbIsChange = true;
      this.marrSelectedItemRecord = pobjFieldData;
      const psEle = document.getElementById('divClsDetails');
      if (psEle != null) {
        psEle.classList.remove('show');
      }
    }
    if (psFieldName == 'Order_Status') {
      this.gridDataList[piIndex]['orderStatusOption'] = this.bmlfSetOrderStatusData(pobjFieldData.Order_Status);
      this.gridDataList[piIndex]['rowColor'] = this.bmlfSetGridLRowColor(pobjFieldData.Order_Status, pobjFieldData.Excp_Code, pobjFieldData.Item_Type);
      this.mbIsChange = true;
    }
    if (psFieldName == 'Confirm_End_Dt') {
      if (this.gridDataList[piIndex]['Confirm_End_Dt'] < this.gridDataList[piIndex]['Confirm_Start_Dt']) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('MPSPLANWORKSHEET.CONFRMDATEALERT'));
        this.gridDataList[piIndex]['Confirm_End_Dt'] = this.gridDataList[piIndex]['Confirm_Start_Dt'];
      }
      this.mbIsChange = true;
    }
    if (psFieldName == 'Confirm_Start_Dt') {
      if (this.gridDataList[piIndex]['Confirm_Start_Dt'] > this.gridDataList[piIndex]['Confirm_End_Dt']) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('MPSPLANWORKSHEET.CONFRMDATEALERT'));
        this.gridDataList[piIndex]['Confirm_End_Dt'] = this.gridDataList[piIndex]['Confirm_Start_Dt'];
      }
      this.mbIsChange = true;
    }
    if (psFieldName == 'PlanEndDt') {
      if (this.mobjSplitOrdData.lineData[piIndex]['PlanEndDt'] < this.mobjSplitOrdData.lineData[piIndex]['PlanStartDt']) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('MPSPLANWORKSHEET.PLANDATEALERT'));
        this.mobjSplitOrdData.lineData[piIndex]['PlanEndDt'] = this.mobjSplitOrdData.lineData[piIndex]['PlanStartDt'];
      }
    }
    if (psFieldName == 'PlanStartDt') {
      if (this.mobjSplitOrdData.lineData[piIndex]['PlanStartDt'] > this.mobjSplitOrdData.lineData[piIndex]['PlanEndDt']) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('MPSPLANWORKSHEET.PLANDATEALERT'));
        this.mobjSplitOrdData.lineData[piIndex]['PlanEndDt'] = this.mobjSplitOrdData.lineData[piIndex]['PlanStartDt'];
      }
    }
    if (psFieldName == 'TransferToSuperBatch') {
      this.mobjTranProdRecSet.SuperBatchType = this.mobjTranProdRecSet.TransferToSuperBatch ? this.marrSuperBatchType[0] : '';
      if (this.mobjTranProdRecSet.TransferToSuperBatch == false) {
        this.mobjTranProdRecSet.FillFormInv = false;
      }
    }
    if (psFieldName == 'Allocate') {
      if (this.mobjTranProdRecSet.Allocate == false) {
        this.mobjTranProdRecSet.AutoLotAssign = false;
      }
    }
    console.log(this.mbIsChange);
  }
