  bmlfTransformObjKey(data) {
    data.forEach(element => {
      Object.keys(element).map(key => {
        let psKey = key.replace(/[/-]/g, '_');
        if (key != 'Type') {
          if (element[key] && typeof element[key] === 'object') {
            this.bmlfTransformObjKey(element[key]);
          }
          element['Date_' + psKey] = element[key];
          delete element[key];
        }
      });
    });
  }
