  // UPDATE line record
  bmlfUpdateLineData(parrData) {
    parrData.forEach(pobjEle => {
      Object.keys(pobjEle).forEach(key => {
        let psKey = key.toUpperCase();
        if (psKey.search('DATE') != -1 || psKey.search('DT') != -1) {
          if (pobjEle[key] && pobjEle[key] != '') {
            let psDtString = pobjEle[key].toString();
            if (!psDtString.includes('/')) {
              pobjEle[key] = moment__WEBPACK_IMPORTED_MODULE_3__(pobjEle[key]).format(this.msCustomDateFormat.toUpperCase());
            }
            let pdtConvNewDT = this.utilService.bmlfSetDateAsDateFormat(pobjEle[key]);
            let pdtDateFormat = moment__WEBPACK_IMPORTED_MODULE_3__(pdtConvNewDT, this.msServeDateFormat);
            pobjEle[key] = moment__WEBPACK_IMPORTED_MODULE_3__(pdtDateFormat).format(this.msServeDateFormat);
          } else {
            pobjEle[key] = '';
          }
        }
      });
      pobjEle.Order_Status = pobjEle.Order_Status.toUpperCase();
      delete pobjEle.rowColor;
      delete pobjEle.orderStatusOption;
      delete pobjEle.gridLineAction;
    });
    return parrData;
  }
